window.bookSummaryJSON = "<p>As the Yuuzhan Vong's devastating conquests continue unchecked, Luke Skywalker and Wedge Antilles are forced to destroy what they have risked their lives to create.</p> <p>Scattering after the Yuuzhan Vong's invasion of Coruscant, the panic-stricken members of the New Republic Advisory Council pause just long enough to set up a mock defense on nearby Borleias and attempt to buy time - which fools no one, least of all the Jedi. Bearing down swiftly on Borleias is a Yuuzhan Vong invasion fleet, determined to destroy the galaxy's remaining defenders.</p> <p>Luke Skywalker's dangerous assignment is to sneak into the Yuuzhan Vong's stronghold on Coruscant. His outrageous scheme to gain entry is either brilliant or suicidal, depending on the outcome.</p>"; 
